INSERT INTO `animal` (`IdAnimal`, `NombreComun`, `NombreCientifico`, `Apodo`, `FechaLlegada`, `FechaSalida`, `TipoAlimentacion_id`, `Habitat_id`, `Especie_id`, `Foto`, `Descripcion`) VALUES
(1, 'León', 'Panthera leo', 'Rey de la Selva', '2023-12-09', '2023-12-09', 3, 1, 1, NULL, 'El león, conocido científicamente como Panthera leo, es un majestuoso felino que habita principalmente en las llanuras de África subsahariana y algunas partes de Asia. Es famoso por su melena, que es distintiva de los machos. Los leones viven en grupos sociales llamados manadas, liderados por un macho dominante. Son depredadores ágiles y poderosos, cazando presas que van desde ñus hasta cebras.'),
(2, 'Águila', 'Haliaeetus leucocephalus', 'Soberana de los Cielos', '2023-12-09', '2023-12-09', 3, 2, 2, NULL, 'Las águilas son majestuosas aves rapaces que se encuentran en todo el mundo. Con una visión aguda y garras poderosas, son depredadores expertos. Existen muchas especies de águilas, cada una adaptada a su hábitat particular. Algunas águilas son conocidas por sus impresionantes vuelos, mientras que otras se especializan en la caza en áreas boscosas.'),
(3, 'Tiburón', 'Carcharhinus carcharias', 'Rey de los Océanos', '2023-12-09', '2023-12-09', 3, 3, 3, NULL, 'Los tiburones son peces depredadores marinos que han existido durante millones de años. Con su forma aerodinámica y sus afilados dientes, los tiburones son cazadores eficientes. Aunque a veces mal entendidos y temidos, desempeñan un papel crucial en el equilibrio de los ecosistemas marinos al controlar las poblaciones de peces.'),
(4, 'Elefante', 'Loxodonta africana', 'Gigante Gris', '2023-12-09', '2023-12-09', 1, 4, 4, NULL, 'Los elefantes son mamíferos terrestres conocidos por su inteligencia y su distintiva trompa larga. Hay dos especies principales: el elefante africano y el elefante asiático. Estos animales sociales viven en manadas lideradas por una hembra mayor. Son herbívoros y desempeñan un papel vital en la ecología de sus hábitats.'),
(5, 'Araña', 'Araneae', 'Tejedora', '2023-12-09', '2023-12-09', 3, 5, 5, NULL, 'Las arañas son artrópodos que pertenecen al orden de los arácnidos. Con miles de especies conocidas, las arañas se encuentran en todo el mundo. Aunque a menudo temidas, son esenciales para el control de insectos, ya que cazan activamente y tejen intrincadas telas para atrapar presas.'),
(6, 'Delfín', 'Delphinidae', 'Juguetón del Mar', '2023-12-09', '2023-12-09', 3, 6, 6, NULL, 'Los delfines son mamíferos marinos inteligentes y sociales. Con su característico hocico alargado y su aleta dorsal, los delfines son conocidos por su comportamiento juguetón y sus acrobacias en el agua. Forman grupos llamados manadas y se comunican mediante clics y silbidos.'),
(7, 'Mariposa Monarca', 'Danaus plexippus', 'Viajera Naranja', '2023-12-09', '2023-12-09', 1, 7, 7, NULL, 'La mariposa monarca es conocida por su espectacular migración anual que abarca miles de kilómetros. Estas mariposas naranjas y negras son famosas por agruparse en grandes colonias durante el invierno en México. Su ciclo de vida incluye una metamorfosis asombrosa, desde huevo hasta oruga, crisálida y finalmente mariposa.'),
(8, 'Cebra', 'Equus zebra', 'Rayas Rápidas', '2023-12-09', '2023-12-09', 1, 8, 8, NULL, 'Las cebras son ungulados herbívoros conocidos por sus rayas distintivas en blanco y negro. Estas rayas sirven como un mecanismo de camuflaje y, a veces, como un medio de identificación individual. Viven en manadas en las llanuras africanas y son presa de depredadores como leones y hienas.'),
(9, 'Serpiente', 'Serpentes', 'Sin Patas', '2023-12-09', '2023-12-09', 3, 9, 9, NULL, 'Las serpientes son reptiles sin extremidades que se encuentran en todo el mundo, desde selvas hasta desiertos. Algunas son venenosas, mientras que otras matan a sus presas por constricción. Aunque a menudo temidas, las serpientes desempeñan un papel vital en el equilibrio de los ecosistemas al controlar las poblaciones de roedores.'),
(10, 'Pingüino', 'Spheniscidae', 'Tux', '2023-12-09', '2023-12-09', 3, 10, 10, NULL, 'Los pingüinos son aves marinas adaptadas para la vida en el agua. Son conocidos por su singular forma de nadar y su habilidad para desplazarse por tierra. Los pingüinos viven en colonias, donde se reproducen y crían a sus crías. Son excelentes nadadores y cazadores de peces en aguas frías.'),
(11, 'Koala', 'Phascolarctos cinereus', 'Oso de Bolsillo', '2023-12-09', '2023-12-09', 1, 11, 11, NULL, 'El koala es un marsupial arbóreo nativo de Australia. Conocidos por su pelaje gris y blanco, los koalas se alimentan principalmente de hojas de eucalipto. Son criaturas nocturnas y pasan la mayor parte de su tiempo descansando en las ramas de los árboles.'),
(12, 'Tortuga', 'Testudines', 'Viajera Lenta', '2023-12-09', '2023-12-09', 2, 12, 12, NULL, 'Las tortugas son reptiles con caparazón que se encuentran en todo el mundo. Viven tanto en agua como en tierra, y algunas especies tienen una longevidad impresionante. Las tortugas desempeñan un papel crucial en el equilibrio de los ecosistemas marinos y terrestres.'),
(13, 'Gorila', 'Gorilla', 'Rey de la Jungla', '2023-12-09', '2023-12-09', 2, 13, 13, NULL, 'Los gorilas son primates inteligentes y poderosos que habitan las selvas de África. Son los primates más grandes y viven en grupos sociales llamados tropas. Los gorilas son herbívoros y juegan un papel importante en la dispersión de semillas en sus hábitats.'),
(14, 'Pulpo', 'Octopus', 'Maestro del Camuflaje', '2023-12-09', '2023-12-09', 3, 14, 14, NULL, 'Los pulpos son cefalópodos marinos conocidos por sus habilidades inteligentes y su capacidad para cambiar de color. Viven en océanos de todo el mundo y son depredadores astutos. Los pulpos son conocidos por su capacidad para escapar y resolver problemas.'),
(15, 'Jirafa', 'Giraffa camelopardalis', 'Reina del Cuello Largo', '2023-12-09', '2023-12-09', 1, 15, 15, NULL, 'La jirafa es el mamífero terrestre más alto y habita en las sabanas y llanuras africanas. Su largo cuello y patas les permiten alimentarse de las hojas más altas de los árboles. Las jirafas son animales sociales que viven en grupos llamados torres.'),
(16, 'Abeja', 'Apis', 'Polinizadora', '2023-12-09', '2023-12-09', 2, 16, 16, NULL, 'Las abejas son insectos polinizadores esenciales para la reproducción de plantas y la producción de alimentos. Viven en colonias organizadas y son conocidas por su danza para comunicar la ubicación de fuentes de alimento. Las abejas juegan un papel crucial en la biodiversidad.'),
(17, 'Leopardo', 'Panthera pardus', 'Veloz y Manchado', '2023-12-09', '2023-12-09', 3, 17, 17, NULL, 'El leopardo es un felino ágil y sigiloso que se encuentra en una variedad de hábitats, desde selvas hasta desiertos. Son cazadores solitarios y nocturnos con una habilidad excepcional para trepar a los árboles. Los leopardos son conocidos por su pelaje moteado.'),
(18, 'Rana', 'Anura', 'Saltarina', '2023-12-09', '2023-12-09', 3, 18, 18, NULL, 'Las ranas son anfibios que se encuentran en una variedad de entornos acuáticos y terrestres. Son conocidas por sus saltos y sus llamadas distintivas durante la época de apareamiento. Las ranas son indicadores importantes de la salud de los ecosistemas acuáticos.'),
(19, 'Búho', 'Strigiformes', 'Sabio Nocturno', '2023-12-09', '2023-12-09', 3, 19, 19, NULL, 'Los búhos son aves rapaces nocturnas conocidas por su visión aguda y vuelo silencioso. Son depredadores eficientes que cazan presas pequeñas como roedores e insectos. Los búhos tienen una variedad de llamadas y son símbolos de sabiduría en algunas culturas.'),
(20, 'Cangrejo', 'Decapoda', 'Caminante Lateral', '2023-12-09', '2023-12-09', 2, 20, 20, NULL, 'Los cangrejos son crustáceos que se encuentran en una variedad de hábitats acuáticos. Con su caparazón duro y garras poderosas, los cangrejos son expertos en la búsqueda de alimentos. Algunas especies de cangrejos también viven en tierra y juegan un papel vital en los ecosistemas costeros.');

